import axios from 'axios'
import React, { Component } from 'react'

export default class UserList extends Component {
    constructor(props){
        super(props)
        this.state ={
            user:[]
        }
    }

    componentDidMount = () =>{
        this.getUsers()
    }

    getUsers =() =>{
        const USER_URL ="https://jsonplaceholder.typicode.com/users"
        axios.get(USER_URL)
        .then(res =>{
            console.log(res)
        })
        .catch(erro => {
            console.log(console.error)
        })

    }
  render() {
    return (
        <>
      <h2>UserList</h2>
      </>
    )
  }
}

